import Navbar from '../components/Navbar'
import './SignUp.css';

function SignUp() {
  return (
    <div className="signup-container">
      <Navbar />
      <div>
          <form>
            <input type="text" id="fname" name="fname" />
            <input type="email" id="fname" name="fname" />
            <input type="password" id="fname" name="fname" />
          </form>
      </div>
    </div>

  );
}

export default SignUp;
